import { many } from "../redusers";
// import { les } from "../redusers";

export const fetchDispatch = () =>{
    return function (dispatch) {
        fetch('https://api.escuelajs.co/api/v1')
      .then(response => response.json())
      .then(json => dispatch(many(json)))
    }
}

export const fetchLesson = () =>{
    return function ( dispatch ) {
        fetch('https://api.escuelajs.co/api/v1/users')
        .then(res => res.json())
        .then(user => dispatch(les(user)));
    }
}
